                        var flattenLayer = new Flatten<double>(previousLayer.OutputShape);
                        layerList.Add(flattenLayer);
                        previousLayer = flattenLayer;
                        break;
                    case (3): // maxpooling
                        var maxPoolingLayer = CreateMaxPoolingLayer(layerIndex, previousLayer);
